import { useState } from "react";
import axios from "axios";
import "./Enroll.css";
import { useNavigate } from "react-router-dom";

const PLAN_CONFIG = {
  "1 Month": { duration: 1, amount: 2000 },
  "3 Months": { duration: 3, amount: 5000 },
  "6 Months": { duration: 6, amount: 9500 },
  "12 Months": { duration: 12, amount: 15000 },
};

const Enroll = () => {
  const [formData, setFormData] = useState({
    phone: "",
    plan: "",
    startDate: "",
    duration: "",
    emergencyContact: "",
    medicalCondition: "",
    paymentMode: "",
    amountPaid: "",
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handlePlanChange = (e) => {
    const selectedPlan = e.target.value;
    const config = PLAN_CONFIG[selectedPlan];

    setFormData({
      ...formData,
      plan: selectedPlan,
      duration: config ? String(config.duration) : "",
      amountPaid: config ? String(config.amount) : "",
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const token = localStorage.getItem("token");

      await axios.post("http://localhost:3001/api/enroll", formData, {
        headers: { Authorization: `Bearer ${token}` },
      });

      navigate("/");
      window.location.reload();
    } catch (err) {
      alert(err.response?.data?.message || "Enrollment failed");
    }
  };

  return (
    <div className="enroll-page">
      <div className="enroll-card">
        <h2>Gym Enrollment</h2>
        <p className="subtitle">Start your fitness journey today</p>

        <form onSubmit={handleSubmit}>
          {/* Phone */}
          <div className="form-group">
            <input
              type="text"
              name="phone"
              placeholder="Mobile Number"
              required
              onChange={handleChange}
            />
          </div>

          {/* Plan */}
          <div className="form-group">
            <select name="plan" required onChange={handlePlanChange}>
              <option value="">Select Membership Plan</option>
              {Object.keys(PLAN_CONFIG).map((plan) => (
                <option key={plan} value={plan}>
                  {plan}
                </option>
              ))}
            </select>
          </div>

          {/* Start Date + Duration */}
          <div className="form-row">
            <input
              type="date"
              name="startDate"
              required
              onChange={handleChange}
            />

            <select name="duration" value={formData.duration} disabled>
              <option value="">Duration</option>
              <option value="1">1 Month</option>
              <option value="3">3 Months</option>
              <option value="6">6 Months</option>
              <option value="12">12 Months</option>
            </select>
          </div>

          {/* Emergency Contact */}
          <div className="form-group">
            <input
              type="text"
              name="emergencyContact"
              placeholder="Emergency Contact Number"
              required
              onChange={handleChange}
            />
          </div>

          {/* Medical Condition */}
          <div className="form-group">
            <textarea
              name="medicalCondition"
              placeholder="Medical Conditions (Optional)"
              onChange={handleChange}
            />
          </div>

          {/* Payment Mode + Amount */}
          <div className="form-row">
            <select
              name="paymentMode"
              required
              onChange={handleChange}
            >
              <option value="">Payment Mode</option>
              <option value="UPI">UPI</option>
              <option value="Cash">Cash</option>
              <option value="Card">Card</option>
            </select>

            <input
              type="number"
              name="amountPaid"
              placeholder="Amount to be Paid"
              value={formData.amountPaid}
              readOnly
            />
          </div>

          <button type="submit" className="enroll-btn">
            Enroll Now
          </button>
        </form>
      </div>
    </div>
  );
};

export default Enroll;
